const Sequelize = require('sequelize')

const sequelize = new Sequelize('admission', 'root', 'kirimarvu', {
  host: 'localhost',
  dialect: 'mysql',
  operatorsAliases: false,

  pool: {
    max: 5,
    min: 0,
    acquire: 30000,
    idle: 10000
  }
})
sequelize.authenticate().then(() => {
  console.log('connection has been esterblish successfully.')
}).catch(err => {
  console.error('unable to connect to the database', err)
})

const User = sequelize.define('user', {
  userName: {
    type: Sequelize.STRING

  },
  email: {
    type: Sequelize.STRING
  }
  // password: {
  //   type: sequelize.STRING
  // }
})
User.sync()

export default User

